import React from 'react';
import './Card.css';

const Card = (props) => {


    return (
        <table>
            <p>id name date</p>
            <p>{props.id}</p>
            <p>{props.name}</p>
            <p>{props.date}</p>
        </table>
    );
};

export default Card;
